function Bar() {
    return (
        <div style={{height: "100px", backgroundColor: "#aa9dff"}}>
            <b style={{fontSize: "45px", textAlign: "center", verticalAlign: "middle"}}> Board </b>
            <button id="btn-default" style={{float: "right", verticalAlign: "bottom"}}> Sign In </button>
        </div>
    );
}

export default Bar;
